import React, { Component } from "react";
import axios from 'axios'
import './Events.css'
import queryString from 'query-string'

class Events extends Component {

    componentDidMount() {

        axios.get('/getEvents')
            .then(res => {
                // let
                console.log(res)
            })

        let parsed = queryString.parse(window.location.search);
        let accessToken = parsed.access_token

        let config = {
            method: 'get',
            url: 'https://www.eventbriteapi.com/v3/categories/103/',
            headers: {
                'Authorization': `Bearer ${accessToken}`
            }
        };

        axios(config)
            .then(function (response) {
                console.log(JSON.stringify(response.data));
            })
            .catch(function (error) {
                console.log(error);
            });

    }

    render() {
        return (
            <div className="events">
                <h2>EVENTS</h2>
            </div>
        );
    }
}

export default Events;

// https://www.eventbrite.com/v3?events/search/?token=ILROY7WB7IH75CCRBEQI&expand=venue&location.within=10km&location.address=london&sort_by=distance&categories=103

